import React, {useEffect, useState} from "react";

function App() {

  const [backend, setBackend] = useState([{}]);

  useEffect(() => {
    fetch("/path/home").then(
      response => response.json()
    ).then(
      data => {
        setBackend(data)
        console.log(data)
      }
    )
  }, [])
  return (

    <div className="App">
      {(typeof backend.myname === 'undefined') ? (
        <p>Loading...</p>
      ): (
        backend.myname.map((user, i) => (
          <p key={i}>{user}</p>
        ))
      )}
    </div>
  );
}

export default App;
